import React from "react";
import LogoutButton from "./LogoutButton";

const HelloPage = (props) => {
    console.log(localStorage.getItem("user"));
    return (<>
            <h1>Начало курсачу положено, {props.user.firstName}!</h1>
            <LogoutButton/>
        </>
    )
}

export default HelloPage
